    def one_p_one_data(self):
        sql ="select * from restaurant_menu where menu_option = '1+1'"
        db = DbConn()
        datas = db.execute(sql)
        db.disconnect()
        return datas

    def two_p_one_data(self):
        sql ="select * from restaurant_menu where menu_option = '2+1'"
        db = DbConn()
        datas = db.execute(sql)
        db.disconnect()
        return datas  

    def sale_data(self):
        sql ="select * from restaurant_menu where menu_option = 'sale'"
        db = DbConn()
        datas = db.execute(sql)
        db.disconnect()
        return datas 

