    def change_page(self):
        if self.tab_index == 1:
            # 1+1
            self.one_page += 1
            self.set_one_plus_one(self.one_page)
        elif self.tab_index == 2:
            # 2+1
            self.two_page += 1
            self.set_two_plus_one(self.two_page)
        elif self.tab_index == 3:
            # sale
            self.sale_page += 1
            self.set_sale(self.sale_page)
      
    def change_back_page(self):
        if self.tab_index == 1:
            # 1+1
            self.one_page -= 1
            self.set_one_plus_one(self.one_page)
        elif self.tab_index == 2:
            # 2+1
            self.two_page -= 1
            self.set_two_plus_one(self.two_page)
        elif self.tab_index == 3:
            # sale
            self.sale_page -= 1
            self.set_sale(self.sale_page)
    
        
    def changeMenu(self, page, btn):
        self.stackedWidget.setCurrentIndex(page)
        self.bt1.setChecked(False)
        self.bt2.setChecked(False)
        self.bt3.setChecked(False)
        self.bt4.setChecked(False)
        if btn == "bt2":
            self.bt2.setChecked(True)
            self.tab_index = 1
        elif btn == "bt3":
            self.bt3.setChecked(True)
            self.tab_index = 2
        elif btn == "bt4":
            self.bt4.setChecked(True)
            self.tab_index = 3

